        public static bool IsPath(int x, int y)
        {
            int _x = x;
            int _y = y;
            if (x < 0)
                _x = maze.GetLength(0) - 1;
            else if (_x >= maze.GetLength(0))
                _x = 0;
            else if (_y < 0)
                _y = maze.GetLength(1) - 1;
            else if (_y >= maze.GetLength(1))
                _y = 0;

            if (maze[_x, _y] == 0 || maze[_x, _y] == 1 || maze[_x, _y] == 2 || maze[_x, _y] == 3 || maze[_x, _y] == 6)
                return true;
            else
                return false;
        }

        private void InitializeObjects()
        {
            for (int i = 0; i < maze.GetLength(0); i++)
            {
                for (int j = 0; j < maze.GetLength(1); j++)
                {
                    Point p;
                    p.x = i;
                    p.y = j;
                    if (maze[i, j] == 1)
                        pacs.Add(p);
                    else if (maze[i, j] == 2)
                        pellets.Add(p);
                }
            }
        }
    }
    
